jQuery(function ($) {
    console.log("dl-p-cuotas: print on woocommerce admin page only");

    $("#woocommerce_dl_p_cuotas_pagalo_pc_version").on("change", function () {
        if (this.value == "1") {
            console.log("oclutar v1 y mostrar campos v1");
            $("#woocommerce_dl_p_cuotas_pagalo_pc_v1_key_public")
                .parent()
                .parent()
                .parent()
                .show();
            $("#woocommerce_dl_p_cuotas_pagalo_pc_v1_key_secret")
                .parent()
                .parent()
                .parent()
                .show();
            $("#woocommerce_dl_p_cuotas_pagalo_pc_v1_token")
                .parent()
                .parent()
                .parent()
                .show();
            $("#woocommerce_dl_p_cuotas_pagalo_pc_v1_idenEmpresa")
                .parent()
                .parent()
                .parent()
                .show();
            $("#woocommerce_dl_p_cuotas_pagalo_pc_v2_credencial")
                .parent()
                .parent()
                .parent()
                .hide();
        }

        if (this.value == "2") {
            console.log("oclutar v2 y mostrar campos v2");
            $("#woocommerce_dl_p_cuotas_pagalo_pc_v1_key_public")
                .parent()
                .parent()
                .parent()
                .hide();
            $("#woocommerce_dl_p_cuotas_pagalo_pc_v1_key_secret")
                .parent()
                .parent()
                .parent()
                .hide();
            $("#woocommerce_dl_p_cuotas_pagalo_pc_v1_token")
                .parent()
                .parent()
                .parent()
                .hide();
            $("#woocommerce_dl_p_cuotas_pagalo_pc_v1_idenEmpresa")
                .parent()
                .parent()
                .parent()
                .hide();
            $("#woocommerce_dl_p_cuotas_pagalo_pc_v2_credencial")
                .parent()
                .parent()
                .parent()
                .show();
        }
    });

    $("#woocommerce_dl_p_cc_pagalo_pc_method").on("change", function () {
        if (this.value == "cybersource") {
            $("#woocommerce_dl_p_cuotas_pagalo_pc_merchantID")
                .parent()
                .parent()
                .parent()
                .show();
        }

        if (this.value == "epay") {
            $("#woocommerce_dl_p_cuotas_pagalo_pc_merchantID")
                .parent()
                .parent()
                .parent()
                .hide();
        }
    });

    $("#woocommerce_dl_p_cuotas_pagalo_pc_version").change();
    $("#woocommerce_dl_p_cuotas_pagalo_pc_method").change();
});
